import React from 'react';
import { Collapse, Button } from 'react-bootstrap';
import Fields from './fieldset.jsx';

const Workspace = ({exploreOpen}) => {

    const datafield  =[{"name":<input type="text" value="" />},{"name":"test2"}];

    return ( 
        <div>
                <Collapse in={exploreOpen}>
                   <div id="example-collapse-text">
                        {datafield.map(function(d, idx){
                                return (<Fields key={idx}>{d.name}</Fields>)
                            })}
                   </div>
          </Collapse>
        </div>
     )
   };
   
   export default Workspace;
